    /**
     * 两数之和
     * 给定一个整数数组 nums 和一个目标值 target，请你在该数组中找出和为目标值的那 两个 整数，并返回他们的数组下标。
     * <p>
     * 你可以假设每种输入只会对应一个答案。但是，你不能重复利用这个数组中同样的元素。
     * <p>
     * 示例:
     * <p>
     * 给定 nums = [2, 7, 11, 15], target = 9
     * <p>
     * 因为 nums[0] + nums[1] = 2 + 7 = 9
     * 所以返回 [0, 1]
     * <p>
     * 来源：力扣（LeetCode）
     * 链接：https://leetcode-cn.com/problems/two-sum
     * 著作权归领扣网络所有。商业转载请联系官方授权，非商业转载请注明出处。
     *
     * @param nums
     * @param target
     * @return
     */
    public int[] twoSum(int[] nums, int target) {
        for (int i = 0; i < nums.length; i++) {
            for (int j = 1 + i; j < nums.length; j++) {
                if (nums[i] + nums[j] == target) {
                    int[] a = new int[2];
                    a[0] = i;
                    a[1] = j;
                    return a;
                }
            }
        }
        return null;
    }

    /**
     * Definition for singly-linked list.
     * public class ListNode {
     * int val;
     * ListNode next;
     * ListNode(int x) { val = x; }
     * }
     */
    //3 7
    //9 2
    public ListNode addTwoNumbers(ListNode l1, ListNode l2) {
        if ((l1.val + l2.val) >= 10) {
            if (l1.next == null && l2.next == null) {
                l1.next = new ListNode(0);
            } else if (l1.next == null) {
                ListNode cur;
                cur = l1;
                l1 = l2;
                l2 = cur;
            }
            l1.next.val = l1.next.val + 1;
        }
        ListNode newListNode = new ListNode((l1.val + l2.val) >= 10 ? l1.val + l2.val - 10 : l1.val + l2.val);

        ListNode temp = newListNode;
        while (l1.next != null || l2.next != null) {
            l1 = l1.next;
            l2 = l2.next;
            if (l2 == null) {
                l2 = new ListNode(0);
            } else if (l1 == null) {
                l1 = new ListNode(0);
            }
            if ((l1.val + l2.val) >= 10) {
                if (l1.next == null && l2.next == null) {
                    l1.next = new ListNode(0);
                } else if (l1.next == null) {
                    ListNode cur;
                    cur = l1;
                    l1 = l2;
                    l2 = cur;
                }
                l1.next.val = l1.next.val + 1;
            }
            ListNode newListNode2 = new ListNode((l1.val + l2.val) >= 10 ? l1.val + l2.val - 10 : l1.val + l2.val);

            while (temp.next != null) {
                temp = temp.next;
            }
            temp.next = newListNode2;
        }
        return newListNode;
    }

    /**
     * ### 描述
     * <p>
     * 给出一个 32 位的有符号整数，你需要将这个整数中每位上的数字进行反转。
     *
     * @param x
     * @return
     */
    public int reverse(int x) {
        int a = 0, b = 0;
        while (x != 0) {
            b = x % 10;
            x /= 10;

            //越界的情况,比最大值大 a>2^31 或者a=2^31 但是首字母>7
            if (a > Integer.MAX_VALUE / 10 || a == Integer.MAX_VALUE / 10 && b > Integer.MAX_VALUE % 10) {
                return 0;
            }
            //越界情况,比最小值小
            if (a < Integer.MIN_VALUE / 10 || a == Integer.MIN_VALUE / 10 && b < Integer.MIN_VALUE % 10) {
                return 0;
            }
            a = a * 10 + b;
        }
        return a;

    }

    /**
     * 回文数
     * 判断一个整数是否是回文数。回文数是指正序（从左向右）和倒序（从右向左）读都是一样的整数。
     *
     * @param x
     * @return
     */
    public boolean isPalindrome(int x) {
        if (x < 0) {
            return false;
        }
        if (x == 0) {
            return true;
        }
        int a = 0, b;
        while (x != 0) {
            b = x % 10;
            a = a * 10 + b;
            x /= 10;
        }

        if (a == x) {
            return true;
        } else {
            return false;
        }

    }

    public int romanToInt(String s) {
        char[] chars = s.toCharArray();
        int[] ints = new int[chars.length];
        for (int i = 0; i < chars.length; i++) {
            switch (chars[i]) {
                case 'I':
                    ints[i] = 1;
                    break;
                case 'V':
                    ints[i] = 5;
                    break;
                case 'X':
                    ints[i] = 10;
                    break;
                case 'L':
                    ints[i] = 50;
                    break;
                case 'C':
                    ints[i] = 100;
                    break;
                case 'D':
                    ints[i] = 500;
                    break;
                case 'M':
                    ints[i] = 1000;
                    break;
            }
        }
        int total = 0;
        for (int i = 0; i < ints.length - 1; i++) {
            if (ints[i] < ints[i + 1]) {
                total = total - ints[i];
            } else {
                total = total + ints[i];
            }
        }
        total = total + ints[ints.length - 1]; //加上最后一个数


        return total;

    }

    /**
     * 最长公共字符串
     * https://leetcode-cn.com/problems/longest-common-prefix/
     *
     * @param strs
     * @return
     */
    public String longestCommonPrefix(String[] strs) {
        //思路：把第一个字符串，分词为多个字符串，找到字符串组里其他里是否包含该字符串
        //因为目的是找最长的字符串，所以先找应该从大往小找，这样能够查找次数最少
        if (strs.length == 0) {
            return "";
        }
        if (strs.length == 1) {
            return strs[0];
        }
        int str0 = strs[0].length(); //最短字符串的长度
        String strShort = strs[0];
        int index = 0;
        for (int i = 1; i < strs.length; i++) {
            if (str0 > strs[i].length()) {
                str0 = strs[i].length();
                strShort = strs[i];
                index = i;
            }
        }
        char[] chars = strShort.toCharArray();
        for (int i = chars.length; i > 0; i--) {
            String s = strShort.substring(0, i);
            boolean flag = true;
            for (int j = 0; j < strs.length; j++) {
                if (j == index) {
                    continue;
                }
                String newString = strs[j].substring(0, i);
                if (!newString.contentEquals(s)) {
                    flag = false;
                }
            }
            if (flag) {
                return s;
            }
        }

        return "";
    }

